select '${clientnumber}' as clientnumber,'' as Division,*,'${clientsourceobject}' as clientsourceobject,
'${clientsourcefield}' as clientsourcefield
from mw.${tablename}

select '' as Division,*,'${clientsourceobject}' as clientsourceobject,
'${clientsourcefield}' as clientsourcefield
from mw.${tablename}

Select distinct *,'Constit_Address' as clientsourceobject,'id' as clientsourcefield, a_id as clientsourceid
from $T{Left Join Address to Constit_Address to Records}
order by a_id

Select *,TRIM(case when IFNULL(Suffix,'') <> '' then Concat(Trim(firstname),' ' , Trim(LastName) , ' ' ,Trim(Suffix))
else Concat(Trim(firstname) ,' ' , Trim(LastName) )
end) as FullName,
case when ConstituentType = 'I' then 'Individual' when ConstituentType = 'O' then 'Organization' end as MWConTypeId
from $T{Left Join Account to AccountAddress}

Select *,case when Type = 'I' then 'Individual' when Type = 'O' then 'Organization' end as MWConTypeID 
from $T{Left Join Demographics and Account}
order by a_acct

Select *,case when a_email = b_email then True else False end as IsPrimary
from $T{Left Join Email and AccountAddress}
order by a_acct

Select *
from $T{Left Join AccountCode and CodeValue}
order by acct

Select *,case when num = phone then True else False end as IsPrimary
from $T{Left Join Phones and AccountAddress}
order by a_acct
